(()=>{"use strict";const e=window.location.origin;$(document).ready((function(){$("#formLogin").submit((function(o){o.preventDefault(),fetch(`${e}/Auth/ValidarLogin`,{method:"POST",body:new FormData(this)}).then((e=>e.ok?e.json():e.json().then((e=>{throw new Error(e.msg||"Ocorreu um erro inesperado tente novamente mais tarde!")})))).then((e=>{alert(e.msg)})).catch((e=>{console.error("Error:",e),alert(e.message)}))}))}))})();